import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

import Footer from "./components/Footer";
import HomePage from "./pages/HomePage";
import ProjectsPage from "./pages/ProjectsPage";
import AboutPage from "./pages/AboutPage";
import ProjectInfo from "./pages/ProjectInfo";

// import { render } from "react-dom/cjs/react-dom.production.min";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      headerLinks: [
        { title: "Home", path: "/" },
        { title: "Projects", path: "/projects" },
        { title: "About", path: "/about" },
      ],
      home: {
        title: "Hi, I'm Dhriti",
        subTitle:
          "I'm a Biomedical Engineering student at the University of Waterloo",
        text: "press cmd k/ ctrl k to learn more about me",
      },
      projects: {
        title: "Some of the projects that I have worked on",
      },
      about: {
        title: "More about me..",
        text: "content",
      },
    };
  }

  render() {
    return (
      <>
        <Router>
          <Container className="p=0" fluid={true}>
            <Navbar>
              <Navbar.Brand>Dhriti Gabani</Navbar.Brand>
              <Nav className="ms-auto">
                <Link className="nav-link" to="/">
                  Home
                </Link>
                <Link className="nav-link" to="/projects">
                  Projects
                </Link>
                <Link className="nav-link" to="/about">
                  About
                </Link>
              </Nav>
            </Navbar>

            <Routes>
              <Route
                path="/"
                element={
                  <HomePage
                    title={this.state.home.title}
                    subTitle={this.state.home.subTitle}
                    text={this.state.home.text}
                  />
                }
              />
              <Route
                path="projects/*"
                element={<ProjectsPage title={this.state.projects.title} />}
              />
              {/* <Route path=":projectId" element={<ProjectInfo />} /> */}
              {/* </Route> */}
              <Route
                path="about"
                element={<AboutPage title={this.state.about.title} />}
              />
            </Routes>
            <Footer />
          </Container>
        </Router>
      </>
    );
  }
}

export default App;
